import React from 'react';

function App() {
  return (
    <div className="App">
   <div id="app">
        <button onclick="createDiv()">Adicionar</button>    
    </div>
    </div>


  );
}

function createDiv() {
  var quadrado = document.createElement('input');
  quadrado.className = 'Quadrado';
  document.body.appendChild(quadrado);
}

export default App;
